  ds = ds.batch(BATCH_SIZE)
  ds = ds.prefetch(buffer_size=AUTOTUNE).cache()
  #ds = ds.interleave(lambda x,y : Dataset.from_tensors(x), num_parallel_calls=AUTOTUNE)
